"批量添加.html",cV="includeVariables",cW="linkType",cX="current",cY="tabbable",cZ="<p><span>BR:</span></p><p><span><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">- 若物品未入库，用户可以从物品管理列表中将该物品添加到库存预警物品列表中。</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">- 添加后系统将保存该物品在物品预警设置列表。</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">UX:</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">- 新添加的物品将显示在列表中其它物品上方。</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">- 同一物品不能重复添加。</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p>",da="cbda71240cd04ffd83737f4dc678f443",db=160,dc="85f724022aae41c594175ddac9c289eb",dd=261,de=236,df="<p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">BR:</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">下拉列表中显示物品管理列表中添加的所有存货类别</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">多选</span></p>",dg="e3118566f82344e7bdf7f5f2adf0f16c",dh=443,di="<p><span>BR:</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">- 与存货类别连动。下拉列表中显示所选存货类别下的所有最小物品分类。</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">- 多选</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">- 例： 若存货类别=半成品， 分类=所有物品分类，物品列表中则显示匹配半成品类别下的所有物品分类的物品。</span></p>",dj="b449bb96a298418485861cd40f4ba076",dk="searchBox",dl=783,dm="fd4d59a43a5d4d0aba01cad6a14ad514",dn="searcBox",dp="3d9e77a2c3124358b7da812db03c8ef6",dq="Text Field",dr="textBox",ds=242,dt=25,du="stateStyles",dv="hint",dw=0xFF999999,dx="b5ff0f35e7314bd2a645185070bd6814",dy=65